using System;
using System.Net.Http;
using Veryfi;

using var client = new HttpClient();
var api = new VeryfiApi("username", "apiKey", "clientId", client);

try
{
	var document = await api.ProcessDocumentAsync(
		new DocumentUploadOptions
		{
			File_name = "fileName.jpg",
			File_data = "data:@file/jpeg;base64,",
		});

	Console.WriteLine($"OcrText: {document.Ocr_text}");
}
catch (ApiException<OperationStatus> exception)
{
    Console.WriteLine($"Exception: {exception.Result.Error ?? exception.Result.Message}");
}